import axios from "axios";

const CreateProductpost = (mydata) => async (dispatch)=>{
    const config = {
        headers: { "Content-Type": "multipart/form-data" },
      };
      const {data} = await axios.post("/admin/product/new", mydata, config).catch((error) => {
        console.error(error);
      });
      if (data.success === true) {
        alert.success("product created");
      }
}

export default CreateProductpost
